script: |
  super -f text -I q1250.spq | sort > q1250.out

inputs:
  - name: q1250.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col2 + + 63 * col0 NOT BETWEEN NULL AND + ( + 39 );
  - name: tab2

outputs:
  - name: q1250.out
    data: |
      46	51	23
      64	77	40
      75	67	58
